import React,{useState,useEffect} from "react";
import axios from 'axios';
import {GET,POST} from '../api/apiAdapter';
import PageLayout from "./PageLayout";

const baseURL="/alchemy"

function ImperialAlchemy() {
   const [data,setData] = useState(null)

   useEffect(() => {
      axios.get(baseURL)
      .then((response)=> {
         setData(response.data)
      })
   })


   return (
      <PageLayout>
         title={
            <>
            <p class="home-title">Welcome!<br/></p>
            <p class='home-description'>
            BDO Tracker is a tool to help Black Desert Online players keep track of various activities including life skill profitability and pearl market sales. 
            If you have any questions, suggestions, or feedback please let me know!
            </p>
            </>
         }

         input={
            <p>Input</p>
         }

         table={
            <p>Table</p>
         }
      </PageLayout>

   )
}


export default ImperialAlchemy
